import EventsEmitter from 'events'
import FiguresConstants from '../constants/FiguresConstants'
import FiguresDispatcher from '../dispatcher/FiguresDispatcher'


class FiguresStore extends EventsEmitter {
  /** Creates figures store. */
  constructor(shapesCount = 6) {
    super();
    this.shapesPosition = [];

    [...Array(shapesCount)].forEach(() => {
      this.shapesPosition.push({
        rotate: { x: 0, y: 0, z: 0, a: 0 }});
    });

    this.shapesCount = shapesCount;
  }

  /** Rotates random shape. */
  rotateShapeRandomly(index, capacity = 1) {
    index = index || Math.floor(Math.random() * (this.shapesCount - 1));
    var rotation =(val = 20) => {
      return Math.random() * val * capacity
    };
    this.shapesPosition[index].rotate = {
      x: rotation(),
      y: rotation(),
      z: rotation(),
      a: rotation(30)
    };
  }

  /** Rotate all shapes. */
  rotateAllShapes(capacity) {
    for (var i = 0; i < this.shapesCount; i++) {
      this.rotateShapeRandomly(i, capacity);
    }
  }

  /**
   * Gets shapes position.
   * @return {Array}
   */
  getShapesPosition() {
    return this.shapesPosition;
  }

  /**
   * Handles figures actions.
   * @param {Object} payload
   */
  handleActions(payload) {
    switch (payload.actionType) {
      case FiguresConstants.ROTATE_RANDOM_SHAPE: {
        this.rotateShapeRandomly();
        this.emit(FiguresConstants.CHANGE_SHAPE_POSITION);
        return true;
      }
      case FiguresConstants.ROTATE_ALL_SHAPES: {
        this.rotateAllShapes(payload.capacity);
        this.emit(FiguresConstants.CHANGE_SHAPE_POSITION);
        return true;
      }
      default: return true;
    }
  }
}

var figuresStore = new FiguresStore();

FiguresDispatcher.register(figuresStore.handleActions.bind(figuresStore));

export default figuresStore

import HeaderDispatcher from '../dispatcher/HeaderDispatcher'
import HeaderConstants from '../constants/HeaderConstants'
import EventEmitter from 'events'

var CHANGE_EVENT = HeaderConstants.SHAPE_CHANGE;

/**
 * HeaderStore
 * @extends EventEmitter
 * @class
 */
class HeaderStore extends EventEmitter {
  /** Creates header store. */
  constructor() {
    super();
    this.state = {
      shapes: ['sphere', 'hexagon', 'triangle'],
      links: ['about', 'experience', 'portfolio', 'contacts']
    };

    this.state.activeShape = this.state.shapes[
        Math.floor(Math.random() * this.state.shapes.length)];
  }

  /**
   * Gets shapes.
   * @return {Array<string>}
   */
  getShapes() {
    return this.state.shapes;
  }

  /**
   * Gets site navigation links.
   * @return {Array<string>}
   */
  getLinks() {
    return this.state.links;
  }

  /**
   * Gets active shape.
   * @return {string}
   */
  getActiveShape() {
    return this.state.activeShape;
  }

  /**
   * Changes selected shape.
   * @param {string} shape Selected shape.
   */
  changeShape(shape) {
    if (this.state.shapes.indexOf(shape) > -1
        && shape !== this.state.activeShape) {
      this.state.activeShape = shape;
      this.emit(CHANGE_EVENT, shape);
      window['ga']('send', {
        hitType: 'event',
        eventCategory: 'ShapeSelect',
        eventAction: 'click',
        eventLabel: shape
      });
    }
  }

  /**
   * Adds change shape listener.
   * @param {Function} callback
   */
  addChangeListener(callback) {
    this.on(CHANGE_EVENT, callback)
  }

  /**
   * Removes change shape listener.
   * @param {Function} callback
   */
  removeChangeListener(callback) {
    this.removeListener(CHANGE_EVENT, callback)
  }

  handleActions(payload) {
    switch (payload.actionType) {
      case HeaderConstants.SHAPE_CHANGE: {
        this.changeShape(payload.shape);
        break;
      }
      default:
        return true;
    }
    return true;
  }
}

var headerStore = new HeaderStore();

HeaderDispatcher.register(headerStore.handleActions.bind(headerStore));

export default headerStore;

